import React, { Component } from "react";
import { Row, Col } from "antd";
class AppContent extends Component {
  state = {};
  render() {
    return (
      <Row>
        <Col span={3}>
          <div
            style={{
              position: "fixed",
              zIndex: 1,
              marginTop: 50,
              overflow: "auto",
              width: "12.5%"
            }}
          ></div>
        </Col>
      </Row>
    );
  }
}

export default AppContent;
